//Cards.js

import React from 'react';
import { data } from '../data';

const Cards = () => {
  return (
    <div>
      {data.map((image) => (
        <div key={image.id}>
          <h3>{image.title}</h3>
          <img src={image.coverImg} alt='image' />
        </div>
      ))}
    </div>
  );
};

export default Cards;

